import React, {Component} from 'react';
import Navigation from "./Navigation";

class Header extends Component {
    render() {
        return (
            <nav className={'navbar row'}>
                <div className={"col-md-5 "}>
                    <Navigation/>
                </div>

                <div className={'col-md-7'}>

                </div>
            </nav>
        );

    }
}

export default Header;
